import React from 'react';

const Task4 = (props) => {
    return (
        <div>
            task 4
            {props.myProps.length && props.myProps.filter(item => (
                <div key={item.id}>
                    <p>{item.title} <small>{item.body}</small></p>
                </div>
            ))}
        </div>
    );
};

export default Task4;
